import React, {Component} from 'react';
import CardList from './CardList';
import Searchbox from './SearchBox'
import {robotInfo} from './robot_info';

class App extends Component
{
	constructor()
	{
		super()
		this.state=
		{
			robot_in:robotInfo,
			searchfield: ''
		}
	}
	render()
	{
		return(
				<div className="tc">
						<h1>Robofriends</h1>
						<Searchbox/>

						<CardList robots_cardList={this.state.robot_in}/>

				</div>
		);
	}
}

export default App;
